const Footer = () => {
    return(
        <div className='footer'>
            <section>
            <h3 style={{fontWeight:'bold'}}>Dylan Collins</h3>
            </section>
            <section>
                <div>this is going other side</div>
            </section>
        </div>
    )
}

export default Footer;
